import CoffeeListStyle from '../Style/CoffeeList.module.css'
import { Link } from 'react-router-dom'
import Pic1 from '../Pic/CoffeeListPic/CinnamonAndCocoa.png'
import Pic2 from '../Pic/CoffeeListPic/C'

const CoffeeList = () => {
    const CoffeeMap = [
        {url:Pic1,price:'$2.00'},
        {url:'../Pic/CoffeeListPic/CinnamonAndCocoa.png',price:'$12.00'},
        {url:'../Pic/CoffeeListPic/CinnamonAndCocoa.png',price:'$22.00'},
        {url:'../Pic/CoffeeListPic/CinnamonAndCocoa.png',price:'$32.00'},
        {url:'../Pic/CoffeeListPic/CinnamonAndCocoa.png',price:'$42.00'},
        {url:'../Pic/CoffeeListPic/CinnamonAndCocoa.png',price:'$52.00'},
    ]
    return (
        <div className={CoffeeListStyle.CoffeeListMain}>

        {CoffeeMap.map(item =>{
            return(
            <div className={CoffeeListStyle.CoffeeItem} key={item.price}>
                <div className={CoffeeListStyle.CoffeeItemImg} style={{backgroundImage: `url(${item.url})`}} >
                    <Link to="/SelectedCoffee"><button></button></Link>
                </div>
                <div className={CoffeeListStyle.CoffeeItemPrice}>{item.price}</div>
                <div className={CoffeeListStyle.CoffeeItemName}>Espresso</div>
            </div>
            )
        })}

        </div>
    )
}

export default CoffeeList
